-- ----------------------------
-- View structure for customer_balances
-- ----------------------------
DROP VIEW IF EXISTS `customer_balances`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `customer_balances` AS select `customers`.`id` AS `id`,`customers`.`fullName` AS `fullName`,`customers`.`telephone` AS `telephone`,`customers`.`initialBalance` AS `initialBalance`,`customers`.`importHash` AS `importHash`,`customers`.`createdAt` AS `createdAt`,`customers`.`updatedAt` AS `updatedAt`,`customers`.`deletedAt` AS `deletedAt`,`customers`.`shopId` AS `shopId`,`customers`.`tenantId` AS `tenantId`,`customers`.`createdById` AS `createdById`,`customers`.`updatedById` AS `updatedById`,(select sum(`sells`.`balanceAmount`) from `sells` where ((`sells`.`customerId` = `customers`.`id`) and (`sells`.`deletedAt` is null))) AS `sellsBalance`,(select sum(`receiptvouchers`.`paidAmount`) from `receiptvouchers` where ((`receiptvouchers`.`customerId` = `customers`.`id`) and (`receiptvouchers`.`deletedAt` is null))) AS `totalpaid`,((ifnull((select sum(`sells`.`balanceAmount`) from `sells` where ((`sells`.`customerId` = `customers`.`id`) and (`sells`.`deletedAt` is null))),0) + ifnull(`customers`.`initialBalance`,0)) - ifnull((select sum(`receiptvouchers`.`paidAmount`) from `receiptvouchers` where ((`receiptvouchers`.`customerId` = `customers`.`id`) and (`receiptvouchers`.`deletedAt` is null))),0)) AS `totalBalance` from `customers` where (`customers`.`deletedAt` is null);

-- ----------------------------
-- View structure for dailypurchases
-- ----------------------------
DROP VIEW IF EXISTS `dailypurchases`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `dailypurchases` AS select `purchaseitems`.`purchaseDate` AS `transactionDate`,sum(`purchaseitems`.`costPrice`) AS `totalPurchase`,`purchaseitems`.`tenantId` AS `tenantId` from `purchaseitems` group by `purchaseitems`.`purchaseDate`,`purchaseitems`.`tenantId`;

-- ----------------------------
-- View structure for dailysells
-- ----------------------------
DROP VIEW IF EXISTS `dailysells`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `dailysells` AS select `sellitems`.`sellDate` AS `transactionDate`,sum(`sellitems`.`total`) AS `totalSell`,`sellitems`.`tenantId` AS `tenantId` from `sellitems` group by `sellitems`.`sellDate`,`sellitems`.`tenantId`;

-- ----------------------------
-- View structure for fullproducts
-- ----------------------------
DROP VIEW IF EXISTS `fullproducts`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `fullproducts` AS select `products`.`id` AS `id`,`products`.`productName` AS `productName`,`products`.`productSerialNumber` AS `productSerialNumber`,`products`.`productQuantity` AS `productQuantity`,`products`.`productPrice` AS `productPrice`,`products`.`purchaseDate` AS `purchaseDate`,`products`.`importHash` AS `importHash`,`products`.`createdAt` AS `createdAt`,`products`.`updatedAt` AS `updatedAt`,`products`.`deletedAt` AS `deletedAt`,`products`.`shopId` AS `shopId`,`products`.`tenantId` AS `tenantId`,`products`.`createdById` AS `createdById`,`products`.`updatedById` AS `updatedById`,((select sum(`purchaseitems`.`quantity`) from `purchaseitems` where ((`purchaseitems`.`productId` = `products`.`id`) and (`purchaseitems`.`deletedAt` is null))) - (select sum(`sellitems`.`quantity`) from `sellitems` where ((`sellitems`.`productId` = `products`.`id`) and (`sellitems`.`deletedAt` is null)))) AS `availableQuantity`,(select `purchaseitems`.`sellingPrice` from `purchaseitems` where ((`purchaseitems`.`productId` = `products`.`id`) and (`purchaseitems`.`deletedAt` is null)) order by `purchaseitems`.`createdAt` desc limit 1) AS `sellingPrice` from `products` where (`products`.`deletedAt` is null);

-- ----------------------------
-- View structure for stocks
-- ----------------------------
DROP VIEW IF EXISTS `stocks`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `stocks` AS select `products`.`id` AS `id`,`products`.`productName` AS `productName`,`products`.`productSerialNumber` AS `productSerialNumber`,(select sum(ifnull(`purchaseitems`.`quantity`,0)) from `purchaseitems` where ((`purchaseitems`.`productId` = `products`.`id`) and (`purchaseitems`.`deletedAt` is null))) AS `totalPurchased`,(select sum(ifnull(`sellitems`.`quantity`,0)) from `sellitems` where ((`sellitems`.`productId` = `products`.`id`) and (`sellitems`.`deletedAt` is null))) AS `totalSold`,((select sum(ifnull(`purchaseitems`.`quantity`,0)) from `purchaseitems` where ((`purchaseitems`.`productId` = `products`.`id`) and (`purchaseitems`.`deletedAt` is null))) - (select sum(ifnull(`sellitems`.`quantity`,0)) from `sellitems` where ((`sellitems`.`productId` = `products`.`id`) and (`sellitems`.`deletedAt` is null)))) AS `totalAvailable`,(select sum((`purchaseitems`.`quantity` * `purchaseitems`.`costPrice`)) from `purchaseitems` where ((`purchaseitems`.`productId` = `products`.`id`) and (`purchaseitems`.`deletedAt` is null))) AS `totalAmountPurchased`,(select sum((`sellitems`.`quantity` * `sellitems`.`price`)) from `sellitems` where ((`sellitems`.`productId` = `products`.`id`) and (`sellitems`.`deletedAt` is null))) AS `totalAmountSold`,`products`.`shopId` AS `shopId`,`products`.`createdAt` AS `createdAt`,`products`.`importHash` AS `importHash`,`products`.`updatedAt` AS `updatedAt`,`products`.`deletedAt` AS `deletedAt`,`products`.`tenantId` AS `tenantId` from `products` where (`products`.`deletedAt` is null);

-- ----------------------------
-- View structure for summarycounts
-- ----------------------------
DROP VIEW IF EXISTS `summarycounts`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `summarycounts` AS select sum(`stocks`.`totalAmountPurchased`) AS `totalPurchased`,sum(`stocks`.`totalAmountSold`) AS `totalSold`,sum(`stocks`.`totalAvailable`) AS `totalProducts`,(select sum(`expenses`.`amount`) from `expenses` where (`expenses`.`deletedAt` is null)) AS `totalExpense`,`stocks`.`tenantId` AS `tenantId` from `stocks` group by `stocks`.`tenantId`;

-- ----------------------------
-- View structure for supplier_balances
-- ----------------------------
DROP VIEW IF EXISTS `supplier_balances`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `supplier_balances` AS select `suppliers`.`id` AS `id`,`suppliers`.`supplierName` AS `supplierName`,`suppliers`.`supplierType` AS `supplierType`,`suppliers`.`supplierTelephone` AS `supplierTelephone`,`suppliers`.`supplierAddress` AS `supplierAddress`,`suppliers`.`initialBalance` AS `initialBalance`,`suppliers`.`importHash` AS `importHash`,`suppliers`.`createdAt` AS `createdAt`,`suppliers`.`updatedAt` AS `updatedAt`,`suppliers`.`deletedAt` AS `deletedAt`,`suppliers`.`shopId` AS `shopId`,`suppliers`.`tenantId` AS `tenantId`,`suppliers`.`createdById` AS `createdById`,`suppliers`.`updatedById` AS `updatedById`,(select sum(`purchases`.`balanceAmount`) from `purchases` where ((`purchases`.`supplierId` = `suppliers`.`id`) and (`purchases`.`deletedAt` is null))) AS `totalBalancePurchase`,(select sum(`expenses`.`amount`) from `expenses` where ((`expenses`.`supplierId` = `suppliers`.`id`) and (`expenses`.`deletedAt` is null))) AS `totalBalanceExpense`,(select sum(`paymentvouchers`.`paidAmount`) from `paymentvouchers` where ((`paymentvouchers`.`supplierId` = `suppliers`.`id`) and (`paymentvouchers`.`deletedAt` is null))) AS `totalPaid`,(((ifnull(`suppliers`.`initialBalance`,0) + ifnull((select sum(`purchases`.`balanceAmount`) from `purchases` where ((`purchases`.`supplierId` = `suppliers`.`id`) and (`purchases`.`deletedAt` is null))),0)) + ifnull((select sum(`expenses`.`amount`) from `expenses` where ((`expenses`.`supplierId` = `suppliers`.`id`) and (`expenses`.`deletedAt` is null))),0)) - ifnull((select sum(`paymentvouchers`.`paidAmount`) from `paymentvouchers` where ((`paymentvouchers`.`supplierId` = `suppliers`.`id`) and (`paymentvouchers`.`deletedAt` is null))),0)) AS `totalBalance` from `suppliers` where (`suppliers`.`deletedAt` is null);

